const Sidebar = (props) => {
  return (
    <div className="sidebar">
      <div className="user-details">
        <p>
          ID: {props.userIds}
          <br />
          <br />
          {props.partnersCount}
          <br />
          <br />
        </p>
        <div className="total-income"></div>
        <div classname="oneMillion"></div>
      </div>
      <div className="divider"></div>
      <div className="my-goals"></div>
      <div className="divider"></div>
      <div className="links"></div>
      <style jsx>{`
        .sidebar {
          height: 100%;
          background: rgba(28, 22, 85, 1);
          border-radius: 20px;
          padding: 10px;
        }
        .divider {
          width: 90%;
          margin: 10px auto;
          background: grey;
          height: 1px;
        }
      `}</style>
      Your referal Link: www.sonstwas.io/{props.userIds}
    </div>
  );
};

export default Sidebar;
